CKEDITOR.plugins.setLang("a11yhelp","es-mx",{title:"Instrucciones de accesibilidad",contents:"Contenidos de ayuda. Para cerrar este cuadro de di\xe1logo presione ESC.",legend:[{name:"General",items:[{name:"Barra de herramientas del editor",legend:"Presione ${toolbarFocus} para navegar a la barra de herramientas. Despl\xe1cese al grupo de barras de herramientas siguiente y anterior con  SHIFT + TAB. Despl\xe1cese al bot\xf3n siguiente y anterior de la barra de herramientas con FLECHA DERECHA o FLECHA IZQUIERDA. Presione SPACE o ENTER para activar el bot\xf3n de la barra de herramientas."},{name:"Editor de di\xe1logo",legend:"Dentro de un cuadro de di\xe1logo, pulse TAB para desplazarse hasta el siguiente elemento de di\xe1logo, pulse MAY\xdaS + TAB para desplazarse al elemento de di\xe1logo anterior, pulse ENTER para enviar el di\xe1logo, pulse ESC para cancelar el di\xe1logo. Cuando un cuadro de di\xe1logo tiene varias pesta\xf1as, se puede acceder a la lista de pesta\xf1as con ALT + F10 o con TAB como parte del orden de tabulaci\xf3n del di\xe1logo. Con la lista de tabuladores enfocada, mueva a la pesta\xf1a siguiente y anterior con las flechas DERECHA y IZQUIERDA, respectivamente."},{name:"Men\xfa contextual del editor",legend:"Presione ${contextMenu} o CLAVE DE APLICACI\xd3N para abrir el men\xfa contextual. A continuaci\xf3n, vaya a la siguiente opci\xf3n del men\xfa con TAB o DOWN ARROW. Despl\xe1cese a la opci\xf3n anterior con SHIFT + TAB o FLECHA ARRIBA. Presione SPACE o ENTER para seleccionar la opci\xf3n del men\xfa. Abra el submen\xfa de la opci\xf3n actual con ESPACIO o ENTER o FLECHA DERECHA. Vuelva al elemento de men\xfa principal con ESC o FLECHA IZQUIERDA. Cerrar el men\xfa contextual con ESC."},{name:"Editor de cuadro de lista",legend:"Dentro de un cuadro de lista, mueva al siguiente elemento de lista con TAB O FLECHA ABAJO. Mueva al elemento anterior de la lista con MAY\xdaS + TAB o FLECHA ARRIBA. Presione SPACE o ENTER para seleccionar la opci\xf3n de lista. Presione ESC para cerrar el cuadro de lista."},{name:"Barra de ruta del elemento del editor",legend:"Presione ${elementsPathFocus} para navegar a la barra de ruta de elementos. Despl\xe1cese al siguiente bot\xf3n de elemento con TAB o FLECHA DERECHA. Despl\xe1cese al bot\xf3n anterior con SHIFT + TAB o FLECHA IZQUIERDA. Presione SPACE o ENTER para seleccionar el elemento en el editor."}]},{name:"Comandos",items:[{name:"Comando deshacer",legend:"Presiona ${undo}"},{name:"Comando rehacer",legend:"Presiona ${redo}"},{name:"Comando negrita",legend:"Presiona ${bold}"},{name:"Comando cursiva",legend:"Presiona {italic}"},{name:"Comando subrayado",legend:"Presiona ${underline}"},{name:"Comando enlace",legend:"Presiona ${link}"},{name:"Comando colapsar barra de herramientas",legend:"Presiona ${toolbarCollapse}"},{name:"Acceda al comando de espacio de enfoque anterior",legend:"Presione ${accessPreviousSpace} para acceder al espacio de enfoque inaccesible m\xe1s cercano antes del cursor, por ejemplo: dos elementos HR adyacentes. Repita la combinaci\xf3n de teclas para alcanzar los espacios de enfoque distantes."},{name:"Acceder al siguiente comando de espacio de enfoque",legend:"Pulse ${accessNextSpace} para acceder al espacio de enfoque m\xe1s cercano inaccesible despu\xe9s del cursor, por ejemplo: dos elementos HR adyacentes. Repita la combinaci\xf3n de teclas para alcanzar los espacios de enfoque distantes."},{name:"Ayuda de accesibilidad",legend:"Presiona ${a11yHelp}"},{name:" Paste as plain text",legend:"Press ${pastetext}",legendEdge:"Press ${pastetext}, followed by ${paste}"}]}],tab:"Tabulador",pause:"Pausa",capslock:"May\xfasculas",escape:"Escape",pageUp:"P\xe1gina arriba",pageDown:"P\xe1gina abajo",leftArrow:"Flecha izquierda",upArrow:"Flecha arriba",rightArrow:"Flecha derecha",downArrow:"Flecha abajo",insert:"Insertar",leftWindowKey:"Tecla izquierda de Windows",rightWindowKey:"Tecla derecha de Windows",selectKey:"Tecla de selecci\xf3n",numpad0:"Teclado num\xe9rico 0",numpad1:"Teclado num\xe9rico 1",numpad2:"Teclado num\xe9rico 2",numpad3:"Teclado num\xe9rico 3",numpad4:"Teclado num\xe9rico 4",numpad5:"Teclado num\xe9rico 5",numpad6:"Teclado num\xe9rico 6",numpad7:"Teclado num\xe9rico 7",numpad8:"Teclado num\xe9rico 8",numpad9:"Teclado num\xe9rico 9",multiply:"Multiplicar",add:"Sumar",subtract:"Restar",decimalPoint:"Punto decimal",divide:"Dividir",f1:"F1",f2:"F2",f3:"F3",f4:"F4",f5:"F5",f6:"F6",f7:"F7",f8:"F8",f9:"F9",f10:"F10",f11:"F11",f12:"F12",numLock:"N\xfameros",scrollLock:"Bloqueo de desplazamiento",semiColon:"punto y coma",equalSign:"Signo igual",comma:"Coma",dash:"Gui\xf3n",period:"Espacio",forwardSlash:"Diagonal",graveAccent:"Acento grave",openBracket:"Abrir par\xe9ntesis",backSlash:"Diagonal invertida",closeBracket:"Cerrar par\xe9ntesis",singleQuote:"Comillas simple"});